import './App.css';
import {Route,Routes,BrowserRouter,Link} from 'react-router-dom';
import Timer from './Timer';
import Navbar from './Navbar';
function App() {
  return (
    <div>
      <BrowserRouter>
        <Routes>
          <Route path='/timer' element={<Timer />}/>
        </Routes> 
      </BrowserRouter>
    </div>
  )
}

export default App;
